import { Route } from "react-router-dom";
import Welcome from "./pages/Welcome";
import Products from "./pages/Products";
import { Fragment } from "react"

function App() {
  return (
    <Fragment>
      <header>

      </header>
      <main>

        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/products">
          <Products />
        </Route>
      </main>
    </Fragment>
  );
}

export default App;
